import NavPane from './NavPane/NavPane';
import PropTypes from 'prop-types'
class Main extends React.Component {

    mainStyle={
        background: "linear-gradient(45deg, #757575, #00649e, #757575)",
        minHeight:"150vh"
    };

    mainContentStyle={
        float:"right",
        display: 'flex',
        backgroundColor: '#e6e6fa90',
        flexDirection: 'column',
        alignItems: 'stretch',
        height:"90vh",
        boxSizing: 'border-box',
        borderRadius:'20px',
        marginTop: '10px',
        fontSize: '16px',
        boxShadow: '0 10px 20px rgba(0,0,0,0.19), 0 6px 6px rgba(0,0,0,0.23)',
    };

    render() {



        return (
            <div className={"container-fluid"} style={this.mainStyle} >
                <NavPane></NavPane>
                <div className={"container-fluid"} style={this.mainContentStyle}>

                </div>
            </div>
        );
    }
}

Main.propTypes = {}

export default Main;
